import PropTypes from 'prop-types';
import Configuration from './Configuration/Configuration';
import NewConfiguration from './NewConfiguration/NewConfiguration';
import { useState } from 'react';
import EditConfiguration from './EditConfiguration/EditConfiguration';
import CreateCardModal from './CreateCardModal/CreateCardModal';

const Configurations = props => {
    const [isCollapsedCard, setIsCollapsedCard] = useState(false);
    const [isVisible, setIsVisible] = useState(false);

    return (
        <>
            <div className='px-6 py-10 flex flex-wrap gap-6'>
                <Configuration
                    title={'Configuration 1'}
                    text={"Today's New's Source, MGT"}
                    isCollapsedCard={isCollapsedCard}
                    setIsCollapsedCard={setIsCollapsedCard}
                >
                    Nat config
                </Configuration>
                <Configuration
                    title={'Configuration 2'}
                    text={"Today's New's Source"}
                    isCollapsedCard={isCollapsedCard}
                    setIsCollapsedCard={setIsCollapsedCard}
                >
                    Nat config 2
                </Configuration>
                <Configuration
                    title={'Configuration 2'}
                    text={"Today's New's Source"}
                    isCollapsedCard={isCollapsedCard}
                    setIsCollapsedCard={setIsCollapsedCard}
                >
                    Nat config 2
                </Configuration>

                <NewConfiguration isVisible={isVisible} setIsVisible={setIsVisible} />
            </div>
            <EditCard isCollapsed={isCollapsedCard} setIsCollapsed={setIsCollapsedCard} />
            <CreateCardModal isVisible={isVisible} setIsVisible={setIsVisible} />
        </>
    );
};

Configurations.propTypes = {};

export default Configurations;
